import React from 'react';
import './FeaturedPost.css'
const FeaturedPost = props => {

    const { id, title, creator, content, image, category} = props.item

    return(
        <div id={id} className="featured-post__container">
            <div>
            <h2>{title}</h2>
            <h3>{category} | {creator}</h3>
            </div>
        </div>
    )
}
export default FeaturedPost;
